import React from "react";
import { useNavigate } from "react-router-dom";

import "../reset.css";
import "../asset/mypage.scss";
import Header from "./header";

function MyPage(props) {
  const navigate = useNavigate();
  return (
    <div>
      <div className="wrap mypage">
        <Header />
        <section className="section_1">
          <div className="profile_wrap">
            <h3 className="myName">
              <b>{props.currentUser}</b>님은
            </h3>
            <p className="myRank">초보완벽러 이십니다!</p>
            <span>MY RANK</span>
          </div>
          <figure className="profile_img">
            <img
              src={`/img/profile${
                loadeedSelect === null ? 1 : loadeedSelect[0]
              }.svg`}
              alt=""
            ></img>
          </figure>
        </section>
        <section className="section_2">
          <ul className="tab_menu">
            <li
              onClick={() => {
                navigate("/profile");
              }}
            >
              프로필이미지변경
              <img src="/img/my_arrow.svg" alt=""></img>
            </li>
            <li
              onClick={() => {
                props.dispatch({ type: "등급표열기" });
              }}
            >
              등급표
              <img src="/img/my_arrow.svg" alt=""></img>
            </li>
            <li>
              <Link to="/introduce">
                개발자인사
                <img src="/img/my_arrow.svg" alt=""></img>
              </Link>
            </li>
            <li
              onClick={() => {
                localStorage.removeItem("currentUser");
                navigate("/login");
              }}
            >
              닉네임변경
              <img src="/img/my_arrow.svg" alt=""></img>
            </li>
          </ul>
        </section>
        {props.rankPoint[0].rankToggle === true ? (
          <RankTable></RankTable>
        ) : null}
      </div>
      <MainFooter></MainFooter>
    </div>
  );
}

export default MyPage;
